import com.eviware.soapui.support.XmlHolder

def holder = new XmlHolder( messageExchange.responseContentAsXml )
holder.namespaces["ns1"] = "http://webservices.currencysystem.com/currencyserver/"
def allCurrencies = holder.getNodeValue( "//ns1:AllCurrenciesResponse[1]/ns1:AllCurrenciesResult[1]" )
def listCur = allCurrencies.toString().tokenize(';')

//def currencies = ["INR", "AUD"]
def currencies = context.expand('${#TC4_CurrencyExists#inputCurrencies}');

for (c in currencies)
	assert c in listCur
